measurements.description:
Three robust flowers on one sturdy upright unstaked 22-cm inflorescence;
 sepals and petals oblong, chartreuse, striped burnt orange along veins,
 darker burnt orange central vein, suffused burnt orange basally;
 lip light yellow, strongly barred dark burgundy apically,
 cream picotee, keel bright yellow; 
column yellow, strongly striped dark red inferior surface, 
 anther cap white;
 substance firm; texture matte.
